import React from 'react';
import './image.css'

const image = (props) => {
  return (
    <div className='fullcontainer'>
    <div className='img'>
     <img src={props.imgaddress}/>
     <div className='btn'><button>Keep Scanning</button> <button>Save As Pdf</button></div>
    </div>
    
    </div>
  )
}

export default image
